import Header from "./Header";

function App() {
  const Features = [
    {
      id: 1,
      title: "Log Calls",
    },

    {
      id: 2,
      title: "Task",
    },
    {
      id: 3,
      title: "Event",
    },
    {
      id: 4,
      title: "Make Note",
    },
    {
      id: 5,
      title: "Add Attachment",
    },
    {
      id: 6,
      title: "Activity Set",
    },
    {
      id: 7,
      title: "Custom Field",
    },
  ];

  return (
    <div className="bg-gray-200 h-full py-16">
      <div className="w-9/12 mx-auto">
        <Header />
        <div className="relative">
          <div className="flex gap-x-6 text-gray-700 text-xl uppercase">
            <span className="cursor-pointer text-orange-500 border-4 border-b-orange-500 absolute bottom-0">
              Activity
            </span>
            <span className="cursor-pointer ml-32">Information</span>
          </div>
          <hr className="bg-gray-500 text-black h-1 w-full " />
        </div>

        {/* --------------------left-------------------- */}
        <div className="w-8/12 mt-6 border border-gray-400 pt-6 bg-white">
          <div className="w-full border-3 border-b border-gray-500">
            <ul className="flex justify-center gap-x-20">
              {Features.map((item, i) => {
                return <li key={i}>{item.title}</li>
              })}
            </ul>
          </div>
        </div>
        {/* --------------------left-------------------- */}

        {/* ------------------------right------------------------ */}
        <div className="w-4/12"></div>
        {/* ------------------------right------------------------ */}
      </div>
    </div>
  );
}

export default App;
